import React, { useState } from 'react';
import { Calculator, AlertCircle } from 'lucide-react';

const PriceCalculator = () => {
  const [formData, setFormData] = useState({
    weight: '',
    zone: 'default'
  });
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const calculatePrice = async (e) => {
    e.preventDefault(); // Add this to prevent form submission
    
    if (!formData.weight || parseFloat(formData.weight) <= 0) {
      setError('Please enter a valid weight');
      return;
    }

    setLoading(true);
    setError('');

    try {
      const response = await fetch('http://localhost:5000/api/calculate-price', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${localStorage.getItem('token')}` // Changed from authToken to token
        },
        body: JSON.stringify({
          weight: parseFloat(formData.weight),
          zone: formData.zone
        })
      });

      const data = await response.json();

      if (!response.ok) {
        throw new Error(data.message || 'Failed to calculate price');
      }

      setResult({
        price: data.price,
        estimatedDays: formData.zone === 'express' ? '1-2' : '3-5'
      });
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="bg-white rounded-lg shadow-sm p-6">
      <h2 className="text-lg font-semibold mb-4">Calculate Shipping Cost</h2>
      
      <div className="space-y-4">
        {/* Weight Input */}
        <div>
          <label className="block text-sm font-medium text-gray-700">
            Package Weight (kg)
          </label>
          <div className="mt-1">
            <input
              type="number"
              value={formData.weight}
              onChange={(e) => setFormData({...formData, weight: e.target.value})}
              step="0.1"
              min="0"
              className="block w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500"
              placeholder="Enter weight in kg"
            />
          </div>
        </div>

        {/* Zone Selection */}
        <div>
          <label className="block text-sm font-medium text-gray-700">
            Shipping Zone
          </label>
          <select
            value={formData.zone}
            onChange={(e) => setFormData({...formData, zone: e.target.value})}
            className="mt-1 block w-full pl-3 pr-10 py-2 text-base border-gray-300 focus:outline-none focus:ring-blue-500 focus:border-blue-500 rounded-md"
          >
            <option value="default">Standard Delivery</option>
            <option value="express">Express Delivery</option>
            <option value="international">International</option>
          </select>
        </div>

        {error && (
          <div className="flex items-center gap-2 text-red-600 bg-red-50 p-3 rounded-md">
            <AlertCircle className="h-5 w-5" />
            <span className="text-sm">{error}</span>
          </div>
        )}

        <button
          onClick={calculatePrice}
          disabled={loading}
          className="w-full flex items-center justify-center px-4 py-2 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
        >
          {loading ? (
            'Calculating...'
          ) : (
            <>
              <Calculator className="h-5 w-5 mr-2" />
              Calculate Price
            </>
          )}
        </button>

        {result && (
          <div className="mt-4 p-4 bg-green-50 rounded-md">
            <h3 className="text-lg font-medium text-green-900">
              Estimated Price
            </h3>
            <div className="mt-2 space-y-2">
              <p className="text-2xl font-bold text-green-600">
                ₹{result.price.toFixed(2)}
              </p>
              <p className="text-sm text-green-700">
                Estimated delivery time: {result.estimatedDays} business days
              </p>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default PriceCalculator;
